    $('.search-pop, .help-pop').popover({
        trigger: 'manual',
        html: true,
        animation: false
    }).on('mouseenter', function() {
        var _this = this;
        $(this).popover('show');
        $('.popover').on('mouseleave', function() {
            $(_this).popover('hide');
        });
    }).on('mouseleave', function() {
        var _this = this;
        $(_this).popover('hide');
    });
    $('.player-search').on('input', function() {
        var val = $(this).val().toLowerCase();
        if (val == '') {
            $('.datarow').removeClass('hidden-row');
        } else {
            val = val.replace(', ', ',').replace(', ', ',').replace(', ', ',').replace(', ', ',').replace(', ', ',').replace(', ', ',').replace(', ', ',').replace(', ', ',').replace(', ', ',').replace(', ', ',').replace(', ', ',').split(',');
            $('.datarow').each(function() {
                var name = $(this).attr('name').toLowerCase();
                var any = 0;
                for (v in val) {
                    if (val[v] == '') {
                        continue;
                    }
                    if (name.includes(val[v])) {
                        $(this).removeClass('hidden-row');
                        any = 1;
                    }
                }
                if (any == 0) {
                    $(this).addClass('hidden-row');
                }
            })
        }
    });

