    function gather_for_download() {

        var out = []

        $('.datarow').each(function() {

            var dict = {}

            dict['course'] = '"' + $(this).children('.course-col').html() + '"';
            var id = $(this).attr('id');
            $.each(current_stats, function(i, stat) {
                console.log($('#' + id).children('.' + stat + '-col'))
                dict[stat] = var_download_display(stat, parseFloat($('#' + id).children('.' + stat + '-col').attr('value')), parseFloat($('#' + id).children('.' + stat + '-col').attr('rank')));

            })

            out.push(dict);

        })

        return out
    }

    function var_download_display(x, val, rank) {
        // console.log(x, val)
        if (val == -99) {
            return null;
        }
        if (stat_display == 'values') {
            if (col_formats['scoring_cols'].indexOf(x) >= 0) {
                var to_fixed = 2;
                if (x.includes('sg')) {
                    var to_fixed = 3;
                }
                return parseFloat(val.toFixed(to_fixed));
            } else if (col_formats['percents'].indexOf(x) >= 0) {
                return parseFloat((val).toFixed(4));
            } else if (col_formats['yards'].indexOf(x) >= 0) {
                return parseFloat(val.toFixed(1));
            } else if (col_formats['commas'].indexOf(x) >= 0) {
                return parseInt(val.toFixed(0));
            } else if (col_formats['floats_3'].indexOf(x) >= 0) {
                return parseFloat(val.toFixed(3));
            } else if (col_formats['floats_2'].indexOf(x) >= 0) {
                return parseFloat(val.toFixed(2));
            } else if (col_formats['ints'].indexOf(x) >= 0) {
                return parseInt(val.toFixed(0));
            }
        } else {
            if (x == 'par') {
                return parseInt(val.toFixed(0));
            } else {
                return parseInt(rank.toFixed(0));
            }
        }
    }

    function arrayToCSV(args) {
        var result, ctr, keys, columnDelimiter, lineDelimiter, data;

        data = args.data || null;
        if (data == null || !data.length) {
            return null;
        }

        columnDelimiter = args.columnDelimiter || ',';
        lineDelimiter = args.lineDelimiter || '\n';

        keys = Object.keys(data[0]);

        result = '';
        result += keys.join(columnDelimiter);
        result += lineDelimiter;

        data.forEach(function(item) {
            ctr = 0;
            keys.forEach(function(key) {
                if (ctr > 0)
                    result += columnDelimiter;

                result += item[key];
                ctr++;
            });
            result += lineDelimiter;
        });

        return result;
    }

    function downloadCSV(args) {
        var data, filename, link;
        var csv = arrayToCSV({
            data: args.data
        });
        if (csv == null)
            return;

        filename = args.filename || 'export.csv';

        if (!csv.match(/^data:text\/csv/i)) {
            csv = 'data:text/csv;charset=utf-8,' + csv;
        }
        data = encodeURI(csv);

        link = document.createElement('a');
        link.setAttribute('href', data);
        link.setAttribute('download', filename);
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);

    }

    function kick_download() {

        var file_name = 'dg_course_table.csv';
        var data_array = gather_for_download();
        downloadCSV({
            data: data_array,
            filename: file_name
        });

    }

